import React, { Component } from 'react';
import {cosimo} from '../firebase/firebase.utils'
class Expenses extends Component {
    
    state = {
        string: ''
    }

    render() {

        

        this.componentDidMount = () => {
           let x = cosimo(this.props.currentUser.displayName, this.props.currentUser.queryID)
           console.log('hello')
           this.setState({
               string: x
           })
        }

        
        
        return (
            <div>
                {this.state.string}
            </div>
        );
    }
}

export default Expenses;
